import React from 'react';
import { Card, Row, Col } from 'react-bootstrap';

const TeamPerformance = () => {
  const teamMembers = [
    { name: 'John Doe', deals: 25, successRate: '85%' },
    { name: 'Jane Smith', deals: 20, successRate: '90%' },
    { name: 'Mike Johnson', deals: 18, successRate: '80%' },
  ];

  return (
    <Card>
      <Card.Header>
        <h5>Team Performance</h5>
      </Card.Header>
      <Card.Body>
        <Row>
          {teamMembers.map((member, index) => (
            <Col key={index} md={4} className="mb-3">
              <Card>
                <Card.Body>
                  <h6 className="mb-1">{member.name}</h6>
                  <p className="mb-1">Deals: {member.deals}</p>
                  <p className="mb-0">Success Rate: {member.successRate}</p>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Card.Body>
    </Card>
  );
};

export default TeamPerformance;
